import React from 'react'

function Weather() {
    return (
        <>
            <div className="container">
                
                <article className="widget">
                    <div className="weatherIcon">
                        <i className="wi wi-day-sunny"></i>
                    </div>
                </article>
            </div>
        </>
    )
}

export default Weather;
